       "\t<tr><td>2835 N McCarren Blvd         </td><td>Sparks         </td><td>2016-05-15 03:03:30</td><td>-2.714286</td><td>Okay very upset that I have to write a bad review.  The lady who was at the window 'preeti' is her name.  She was extremely unprofessional and damn right rude!! 1st seems pissed off by just seeing my face,doesn't give me a receipt, and as I'm waiting to ask her for it she rolls her eyes at me,so that pissed me off so I wait to tell her to be a little more respectful to customers and she closed the window on me while I was talking! !!!!!!!!!!! Corporate will hear from me if her boss doesn't do something about this.                 </td></tr>\n",
       "\t<tr><td>407 N Virginia St            </td><td>Reno           </td><td>2018-09-24 00:25:20</td><td>-2.714286</td><td>KYLIE HAS TERRIBLE CUSTOMER SERVICE SKILLS AND A VERY NASTY ATTITUDE. The ladies that work their are very rude. Insulted me on my vacation. And my coffee and food was very cold and nasty. If you hate your life because you work at Starbucks then quit, don't take it out on the customers. WORST Starbucks i have ever been too.                                                                                                                                                                                                                    </td></tr>\n",
       "\t<tr><td>1001-1005 Chestnut St        </td><td>Philadelphia   </td><td>2018-01-31 22:16:41</td><td>-2.666667</td><td>Gross!! \n",
       "Toilet is fucking disgusting,one homeless woman taking over the condiment station eating and drinking her coffee and looking in the trash and another one talking to him \n",
       "Self in the seating area. No place to sit and it's freezing outside and I just paid $5 for coffee. FUCK this place                                                                                                                                                                                                                                                 </td></tr>\n",
       "\t<tr><td>50 South Houghton Rd, Ste 126</td><td>Tucson         </td><td>2016-07-27 08:49:18</td><td>-2.666667</td><td>Kleine Starbucks Filiale. Nichts Besonderes, leider gibt es nur 2 bequeme Sessel, ansonsten nur harte Holzstühle.\n",
