       "Ich habe bei allen probiert :-), alles war sehr lecker.                                                                               </td></tr>\n",
       "\t<tr><td>6363 Saint Charles Ave       </td><td>New Orleans    </td><td>2018-09-05 15:22:58</td><td>-2.600000</td><td>I absolutely hate going to this Starbucks, but I go occasionally because it's on my university campus. It is literally awful. The line is always very long. Then, when you get to the register they are ALWAYS out of everything. The staff is so rude!!! Today when I went, they were out of all alternative options of milk, which I am allergic to. They did not have almond, coconut or soy milk. This is a terrible place!!!!!!!!!!!!!!!!!                                                                                                         </td></tr>\n",
       "\t<tr><td>5220 Little Rd               </td><td>New Port Richey</td><td>2015-09-28 16:22:48</td><td>-2.600000</td><td>As a Starbucks partner myself I expect to be treated exactly how we are trained to treat our customers when I go to a store. This Starbucks has the worst customer service I've seen in any Starbucks. \n",
       "I went through the drive thru. \n",
       "My order was rushed, put in incorrectly and misunderstood. When I got to the window the barista didn't have his name tag on and he was uninterested. I was charged for a drink I didn't receive. The shots were dead. The sandwich's egg was still frozen as well. This store should be ashamed of themselves.</td></tr>\n",
       "\t<tr><td>2701 Castor Ave              </td><td>Philadelphia   </td><td>2016-09-08 18:10:59</td><td>-2.600000</td><td>NASTY!\n",
