       "\t<tr><td>3401 Walnut St               </td><td>Philadelphia   </td><td>2019-10-21 11:54:54</td><td>-2.600000</td><td>WORST COFFEE WORST SERVICE.  I have not been there in 2 years because of that. I decided to go there this morning and after spending $7.00 on a coffee and a danish, I threw it out when I got to my office.\n",
