       "\t<tr><td>1401 Virginia Dr             </td><td>Dresher        </td><td>2021-08-19 13:33:40</td><td>-2.600000</td><td>This Starbucks has racist employees thst work for the company and needs to be fired ASAP !! This isn't back in the day this is now and no one should be getting called racist slurs while working for any company we ain't playing that shit !!!!                                                                                                                                                                                                                                                                                                       </td></tr>\n",
