       "7  Kleine Starbucks Filiale. Nichts Besonderes, leider gibt es nur 2 bequeme Sessel, ansonsten nur harte Holzstühle.\\nDie Bedienung war nett (was bei Starbucks nicht immer der Fall ist). Die Getränke schmeckten wie überall, was die Sache sehr angenehm macht. Man weiß, was man bekommt.\\nMeine Gattin hatte Strawberry Smoothie, die Kids den \"Very Berry Hibiscus\" und ich, wie fast immer, den Venti Latte.\\nIch habe bei allen probiert :-), alles war sehr lecker.                                                                               \n",
       "8  I absolutely hate going to this Starbucks, but I go occasionally because it's on my university campus. It is literally awful. The line is always very long. Then, when you get to the register they are ALWAYS out of everything. The staff is so rude!!! Today when I went, they were out of all alternative options of milk, which I am allergic to. They did not have almond, coconut or soy milk. This is a terrible place!!!!!!!!!!!!!!!!!                                                                                                         \n",
       "9  As a Starbucks partner myself I expect to be treated exactly how we are trained to treat our customers when I go to a store. This Starbucks has the worst customer service I've seen in any Starbucks. \\nI went through the drive thru. \\nMy order was rushed, put in incorrectly and misunderstood. When I got to the window the barista didn't have his name tag on and he was uninterested. I was charged for a drink I didn't receive. The shots were dead. The sandwich's egg was still frozen as well. This store should be ashamed of themselves.\n",
       "10 NASTY!\\nI was there yesterday, second in line it took about 15 minutes for them to finish 1 order before me (4 mocha frap crap) yes!\\nAlso first time in my life to see FLIES in a starbucks whether target or not.\\nFUCK THIS SHIT                                                                                                                                                                                                                                                                                                                     \n",
       "11 WORST COFFEE WORST SERVICE.  I have not been there in 2 years because of that. I decided to go there this morning and after spending $7.00 on a coffee and a danish, I threw it out when I got to my office.\\nFor some reason the girl decided to heat my danish in a dirty oven because when I opened it there were flecks of burnt something on it.\\n I did not ask for it to be heated.  The coffee was not hot.  There was no half and half. I had to wait for that to be filled.. So why in hell would anyone go there???????????????              \n",
       "12 This Starbucks has racist employees thst work for the company and needs to be fired ASAP !! This isn't back in the day this is now and no one should be getting called racist slurs while working for any company we ain't playing that shit !!!!                                                                                                                                                                                                                                                                                                       \n",
       "13 No stars. This place is the worst. Service sucks , people suck, all around just sucks.                                                                                                                                                                                                                                                                                                                                                                                                                                                                  "
      ]
     },
     "metadata": {},
     "output_type": "display_data"
    }
   ],
   "source": [
    "customer_sentiment %>%\n",
    "  arrange(sentiment) %>%                     # Sort reviews from most negative to most positive\n",
