     "data": {
      "text/html": [
       "<table class=\"dataframe\">\n",
       "<caption>A tibble: 20 × 5</caption>\n",
       "<thead>\n",
       "\t<tr><th scope=col>address</th><th scope=col>city</th><th scope=col>date</th><th scope=col>sentiment</th><th scope=col>text</th></tr>\n",
       "\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n",
       "</thead>\n",
       "<tbody>\n",
       "\t<tr><td>6291 E Speedway Blvd                </td><td>Tucson      </td><td>2013-11-08 17:06:06</td><td>3.400000</td><td>Stuff is awesome the service is fast and amazing. This Starbucks is always busy but you never wait to long.  Starbucks coffee is a little over priced but once in a while its good. Love the holiday flavors. Pumpkin spice one of the best of all times.                                                                                                                                                                                                                                             </td></tr>\n",
       "\t<tr><td>9525 E Old Spanish Trl, Ste 113     </td><td>Tucson      </td><td>2016-08-08 16:35:09</td><td>3.400000</td><td>Love this Starbucks. Excellent customer service. Lawson is the manager and has such an awesome staff. I come here on a daily basis because of the atmosphere and awesome customer service I get. They have plenty of seating both inside and out. I come here to drink my coffee and relax. Love this place.                                                                                                                                                                                          </td></tr>\n",
       "\t<tr><td>330 S Virginia St                   </td><td>Reno        </td><td>2019-02-22 23:25:01</td><td>3.400000</td><td>I think this is honestly one of the best Starbucks in town and I don't say that because it's next to where I work. The service is always great even when they're in the middle of a rush. I have always had great tasting drinks and awesome recommendations by the baristas. Keep up the awesome work guys!                                                                                                                                                                                          </td></tr>\n",
       "\t<tr><td>10002 N Dale Mabry Hwy              </td><td>Tampa       </td><td>2019-02-10 00:12:34</td><td>3.400000</td><td>Wow this place is huuuge! Very nice chill spot. Loved it and need to find a reason to go out of my way to go there. The drink i had was amazing. People were nice too                                                                                                                                                                                                                                                                                                                                 </td></tr>\n",
       "\t<tr><td>6970 E 22nd St, Ste 112             </td><td>Tucson      </td><td>2019-07-03 14:14:33</td><td>3.333333</td><td>This location (22nd and Kolb) has hands down had the best service each and every time! They are consistent with their great team work, superb customer service and awesome quality/speed of the menu items. My Momma raves about this location and the few times I've been here, they have lived up to her praises!                                                                                                                                                                                   </td></tr>\n",
       "\t<tr><td>1199 Terry Pkwy                     </td><td>Gretna      </td><td>2017-11-07 20:16:08</td><td>3.250000</td><td>The partners out here are super great! my family is visiting from California! I just so happen to be a partner from California. The partners out here are amazing and I love the fact that this Starbucks happens to be around the corner from where I stay!!  Nelly Nel was the first to show that good old Louisiana southern hospitality, Mo and Sarah were awesome as well! Thank you guys for making my experince here an fantastic one!!! #tobeapartner!!!                                      </td></tr>\n",
       "\t<tr><td>204 S Royal Oaks Blvd               </td><td>Franklin    </td><td>2015-05-23 19:00:21</td><td>3.200000</td><td>Consistently good drinks and all the people working there are super nice and awesome. It can get busy at times but that's just because SB is great :)                                                                                                                                                                                                                                                                                                                                                 </td></tr>\n",
       "\t<tr><td>2401 East Bay Dr, Ste 1             </td><td>Largo       </td><td>2020-08-10 14:23:26</td><td>3.200000</td><td>I come to this Starbucks a lot. But this morning the person at the window made my day extra fabulous!!! They had black and red hair, they were super nice and made me feel so good!! I didn't get to catch their name, but they deserve praise!!                                                                                                                                                                                                                                                      </td></tr>\n",
       "\t<tr><td>7373 West Fairview                  </td><td>Boise       </td><td>2014-03-08 20:50:05</td><td>3.200000</td><td>Love this particular Starbucks it is much bigger than the other stores in the valley and it is right next to axiom nice to come her in the morning after a workout. Service is always awesome and there are plenty of funny and interesting people! Saul is the nicest guy! He's the Mann!                                                                                                                                                                                                            </td></tr>\n",
       "\t<tr><td>601 Poydras St                      </td><td>New Orleans </td><td>2016-10-30 22:08:35</td><td>3.200000</td><td>Awesome location with amazing people working. Always do their best and strive to make you happy and enjoy your visit. AAA+++                                                                                                                                                                                                                                                                                                                                                                          </td></tr>\n",
       "\t<tr><td>6680 Edwardsville Crossing Dr       </td><td>Edwardsville</td><td>2014-05-04 00:49:17</td><td>3.200000</td><td>First off let me say that they are always busy, BUT they have good service and if you go before closing time, which I believe is 11pm, you could get the samples they didn't give out during the day!!! Love love LOVE Starbucks. It is pricey, but for their coffee I do not mind. If you can go, you need to bring your friends/ family cause it is AMAZING!                                                                                                                                        </td></tr>\n",
       "\t<tr><td>1300 E 86th St, Ste 35, Target      </td><td>Indianapolis</td><td>2016-09-03 15:42:37</td><td>3.200000</td><td>Very friendly and excellent staff, the inside of the Starbucks has an awesome Decour and it is awesome to work out for a long period of time. Dislocations drive-through is a bit slower than other Starbucks I've been to but overall a very good experience!                                                                                                                                                                                                                                        </td></tr>\n",
       "\t<tr><td>1209 W Irvington Rd, Ste 150        </td><td>Tucson      </td><td>2012-03-26 08:22:22</td><td>3.200000</td><td>Great place with fabulous people behind the counter. Always cheerful and go the extra mile. Great coffee and awesome conversion;)                                                                                                                                                                                                                                                                                                                                                                     </td></tr>\n",
       "\t<tr><td>1128 Walnut St                      </td><td>Philadelphia</td><td>2020-11-13 00:02:54</td><td>3.200000</td><td>Amazing staff and store! I love visiting this Starbucks location! My drink is always made perfectly and several times the staff has gone above and beyond to make my Starbucks trip great!:) The Pumpkin Cream Cold Brew is my go to seasonal fall drink! The perfect blend of creaminess and pumpkin spice!                                                                                                                                                                                          </td></tr>\n",
       "\t<tr><td>13660 Walsingham Rd                 </td><td>Largo       </td><td>2020-11-26 16:01:21</td><td>3.200000</td><td>This is the most amazing Starbucks ever!! Their staff is so hardworking and such a fantastic group. I love getting to chit chat with everyone, especially when I go through the drive through.  Every time I have come here it's always been such a great experience and my drinks always come out right. I would highly recommend you come to this Starbucks!!                                                                                                                                       </td></tr>\n",
       "\t<tr><td>443 E Baltimore Ave                 </td><td>Media       </td><td>2013-05-10 01:05:47</td><td>3.200000</td><td>This is my local Starbucks and it's amazing! New staff is super nice!! Drinks are yummy!! Glad there has been a serious change!! This is what I expect when I visit Starbucks!                                                                                                                                                                                                                                                                                                                        </td></tr>\n",
       "\t<tr><td>700 Canal St                        </td><td>New Orleans </td><td>2015-01-27 22:07:32</td><td>3.200000</td><td>This was a wonderful Starbucks. First of all, it is very large. The service rivals any that I've been to around the country.\n",
       "\n",
       "I was absolutely taken by the way they decorated it. As one would expect, the decor is very much New Orleans - lots music and jazz related items. Great fixtures and chandeliers, and a terrific mural that depicts the French Quarter.\n",
       "\n",
       "Starbucks did a great job with this one. Our group spend some time sitting there, enjoying our coffee and the surroundings.</td></tr>\n",
       "\t<tr><td>690 Keystone Ave                    </td><td>Reno        </td><td>2015-01-17 06:34:35</td><td>3.200000</td><td>I LOVE this location! Not only is it super convenient for me, but the staff is amazing! Always friendly and patient! Especially Megan! She is amazing!                                                                                                                                                                                                                                                                                                                                                </td></tr>\n",
       "\t<tr><td>10080 Jasper Avenue, Empire Building</td><td>Edmonton    </td><td>2018-09-03 04:48:37</td><td>3.200000</td><td>Fun music....a nice change!  \n",
       "\n",
       "Some good staff.  Some great staff. Grateful it was not busy. \n",
       "\n",
       "The rest you know if you go to Starbucks.                                                                                                                                                                                                                                                                                                                                                          </td></tr>\n",
       "\t<tr><td>9175 Carothers Pkwy, Ste 101        </td><td>Franklin    </td><td>2016-04-05 21:34:40</td><td>3.200000</td><td>This is a fantastic Starbucks!!! 10/10 would recommend. The coffee is great as always and it is very cozy inside. The baristas there are all super awesome as well.                                                                                                                                                                                                                                                                                                                                   </td></tr>\n",
       "</tbody>\n",
       "</table>\n"
      ],
