       "   text                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  \n",
       "1  Stuff is awesome the service is fast and amazing. This Starbucks is always busy but you never wait to long.  Starbucks coffee is a little over priced but once in a while its good. Love the holiday flavors. Pumpkin spice one of the best of all times.                                                                                                                                                                                                                                             \n",
       "2  Love this Starbucks. Excellent customer service. Lawson is the manager and has such an awesome staff. I come here on a daily basis because of the atmosphere and awesome customer service I get. They have plenty of seating both inside and out. I come here to drink my coffee and relax. Love this place.                                                                                                                                                                                          \n",
       "3  I think this is honestly one of the best Starbucks in town and I don't say that because it's next to where I work. The service is always great even when they're in the middle of a rush. I have always had great tasting drinks and awesome recommendations by the baristas. Keep up the awesome work guys!                                                                                                                                                                                          \n",
       "4  Wow this place is huuuge! Very nice chill spot. Loved it and need to find a reason to go out of my way to go there. The drink i had was amazing. People were nice too                                                                                                                                                                                                                                                                                                                                 \n",
       "5  This location (22nd and Kolb) has hands down had the best service each and every time! They are consistent with their great team work, superb customer service and awesome quality/speed of the menu items. My Momma raves about this location and the few times I've been here, they have lived up to her praises!                                                                                                                                                                                   \n",
       "6  The partners out here are super great! my family is visiting from California! I just so happen to be a partner from California. The partners out here are amazing and I love the fact that this Starbucks happens to be around the corner from where I stay!!  Nelly Nel was the first to show that good old Louisiana southern hospitality, Mo and Sarah were awesome as well! Thank you guys for making my experince here an fantastic one!!! #tobeapartner!!!                                      \n",
       "7  Consistently good drinks and all the people working there are super nice and awesome. It can get busy at times but that's just because SB is great :)                                                                                                                                                                                                                                                                                                                                                 \n",
       "8  I come to this Starbucks a lot. But this morning the person at the window made my day extra fabulous!!! They had black and red hair, they were super nice and made me feel so good!! I didn't get to catch their name, but they deserve praise!!                                                                                                                                                                                                                                                      \n",
       "9  Love this particular Starbucks it is much bigger than the other stores in the valley and it is right next to axiom nice to come her in the morning after a workout. Service is always awesome and there are plenty of funny and interesting people! Saul is the nicest guy! He's the Mann!                                                                                                                                                                                                            \n",
       "10 Awesome location with amazing people working. Always do their best and strive to make you happy and enjoy your visit. AAA+++                                                                                                                                                                                                                                                                                                                                                                          \n",
       "11 First off let me say that they are always busy, BUT they have good service and if you go before closing time, which I believe is 11pm, you could get the samples they didn't give out during the day!!! Love love LOVE Starbucks. It is pricey, but for their coffee I do not mind. If you can go, you need to bring your friends/ family cause it is AMAZING!                                                                                                                                        \n",
       "12 Very friendly and excellent staff, the inside of the Starbucks has an awesome Decour and it is awesome to work out for a long period of time. Dislocations drive-through is a bit slower than other Starbucks I've been to but overall a very good experience!                                                                                                                                                                                                                                        \n",
       "13 Great place with fabulous people behind the counter. Always cheerful and go the extra mile. Great coffee and awesome conversion;)                                                                                                                                                                                                                                                                                                                                                                     \n",
       "14 Amazing staff and store! I love visiting this Starbucks location! My drink is always made perfectly and several times the staff has gone above and beyond to make my Starbucks trip great!:) The Pumpkin Cream Cold Brew is my go to seasonal fall drink! The perfect blend of creaminess and pumpkin spice!                                                                                                                                                                                          \n",
       "15 This is the most amazing Starbucks ever!! Their staff is so hardworking and such a fantastic group. I love getting to chit chat with everyone, especially when I go through the drive through.  Every time I have come here it's always been such a great experience and my drinks always come out right. I would highly recommend you come to this Starbucks!!                                                                                                                                       \n",
       "16 This is my local Starbucks and it's amazing! New staff is super nice!! Drinks are yummy!! Glad there has been a serious change!! This is what I expect when I visit Starbucks!                                                                                                                                                                                                                                                                                                                        \n",
       "17 This was a wonderful Starbucks. First of all, it is very large. The service rivals any that I've been to around the country.\\n\\nI was absolutely taken by the way they decorated it. As one would expect, the decor is very much New Orleans - lots music and jazz related items. Great fixtures and chandeliers, and a terrific mural that depicts the French Quarter.\\n\\nStarbucks did a great job with this one. Our group spend some time sitting there, enjoying our coffee and the surroundings.\n",
       "18 I LOVE this location! Not only is it super convenient for me, but the staff is amazing! Always friendly and patient! Especially Megan! She is amazing!                                                                                                                                                                                                                                                                                                                                                \n",
