       "\t<tr><td>Okay very upset that I have to write a bad review.  The lady who was at the window 'preeti' is her name.  She was extremely unprofessional and damn right rude!! 1st seems pissed off by just seeing my face,doesn't give me a receipt, and as I'm waiting to ask her for it she rolls her eyes at me,so that pissed me off so I wait to tell her to be a little more respectful to customers and she closed the window on me while I was talking! !!!!!!!!!!! Corporate will hear from me if her boss doesn't do something about this.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                </td></tr>\n",
