       "Ich habe bei allen probiert :-), alles war sehr lecker.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              </td></tr>\n",
       "\t<tr><td>I absolutely hate going to this Starbucks, but I go occasionally because it's on my university campus. It is literally awful. The line is always very long. Then, when you get to the register they are ALWAYS out of everything. The staff is so rude!!! Today when I went, they were out of all alternative options of milk, which I am allergic to. They did not have almond, coconut or soy milk. This is a terrible place!!!!!!!!!!!!!!!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        </td></tr>\n",
       "\t<tr><td>As a Starbucks partner myself I expect to be treated exactly how we are trained to treat our customers when I go to a store. This Starbucks has the worst customer service I've seen in any Starbucks. \n",
       "I went through the drive thru. \n",
       "My order was rushed, put in incorrectly and misunderstood. When I got to the window the barista didn't have his name tag on and he was uninterested. I was charged for a drink I didn't receive. The shots were dead. The sandwich's egg was still frozen as well. This store should be ashamed of themselves.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               </td></tr>\n",
