       "\t<tr><td>Rude as hell the worst service didn't shake drink didn't even use manners I work in service I understand how hard it can be but the experience I had was ridiculous rude                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               </td></tr>\n",
       "\t<tr><td>I hate that this is the only Starbucks close to my work because it has the absolute worst customer service of any Starbucks I've ever been to.\n",
       "\n",
       " I always order ahead and do a mobile order so that I can come in and grab my drink and go but there have been multiple times where I have to wait 5 minutes for my drink because the dumb ass teenagers who work there are too busy standing at the register doing nothing.\n",
