       "Once I came in and there were a few people standing by the window where you receive your drinks, so I asked the girl at the register- with short blond hair (who was doing absolutely nothing at the time) if she could hand me my mobile order and she told me to wait at the window with the other people. There was a guy making multiple drinks, so I stood there and waited five minutes and he was too busy to hand me my drink, so I went back to the girl with short blond hair and asked her to hand me my drink. She handed it to me and then proceeded to chastise me about how busy they were.\n",
