       "\n",
       "These are only two examples. There are more but this review is already too long.</td></tr>\n",
       "\t<tr><td>The absolute worst Starbucks! I went the other day, got my usual order of iced coffee and a bagel, and the worker told me the price was $8 which I knew seemed high, but when she read back my order she only mentioned my two items, so I paid and waited for my things. I then got to the pick up counter and got my bagel and iced coffee, the only two things I ordered, but found out later after I left that I was also charged for a croissant! The sticker on my cup even said items 1 and 2 of 3 items! I was basically cheated out of money by this Starbucks! There was no croissant there for me and I NEVER ordered one! The barista only even read my back my two items as she checked the order! This is completely unacceptable in my opinion. I've vowed to never return to this Starbucks and have also told my friends to never bother unless they plan on being over charged!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      </td></tr>\n",
       "\t<tr><td>AWFUL and rude!! I got there at 7 and ordered a regular cup of coffee to go. Got to my car and it was cold!   Went back in and she was nasty.  She ignored me.  I had to wait about 10 minutes for another cup.  She never apologized.  I heard the barista call her name.  Later that day I called to tell the manager my horrible experience and it was the manager who was so nasty!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              </td></tr>\n",
       "\t<tr><td>Worst service from any airport Starbucks that I have ever had.  This is the Starbucks by E29,and I will tell ypu that I am also tempted to never frequent a Starbucks again!!!\n",
       "\n",
       "When I worked in Customer Service jobs, it was not the customer's privilege to order anthing, it was my prvilege to serve them.  Here, the utter disdain and disgust that the barrista had for my order was shocking.  I apparenlty bothered her by ordering a Cold Brew!!\n",
       "\n",
       "To say the least, will never order from Starbucks in STL again.......                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  </td></tr>\n",
       "\t<tr><td>Terrible service, even worse management. They wont cuz any of their mistakes. Rude and annoying, just go to mcdonalds for coffee                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       </td></tr>\n",
       "\t<tr><td>This is the absolute worst Starbucks I have ever been to. The line is awful, the service is slow, and the employees are rude and inconsiderate. Many times in a row they've messed up my order and made me wait. I started ordering online and they still don't make it until I get there.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             </td></tr>\n",
       "\t<tr><td>Horrible service. Felt bad for the front line associate that was poorly trained. Sad...train wreck.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    </td></tr>\n",
       "\t<tr><td>Worst experience at a Starbucks ever!!! I worked at Starbucks for 5 years and have never had this bad of an experience! No names on cups! Cluster f***. Baristas talking crap about customers who were less than 3 feet away! Absolutely unacceptable!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               </td></tr>\n",
       "\t<tr><td>The worst Starbucks, not to mention the rudest one, in the city. I went there today to get my mobile order, which was suppose to be ready, and it wasn't. The staff was downright rude to the customers, plus I was rudely told to \"put your mask on\" when it slipped off my face for less than 5 seconds. I take COVID VERY seriously. I know people who are working on the front lines, not to mention who have caught this awful disease. I could've been politely told to fix my mask. Did I mention my order wasn't ready until 10 min AFTER I got the text that it was SUPPOSE to be ready? This Starbucks is awful. I will never go hear again.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 </td></tr>\n",
       "\t<tr><td>This is THE worst Starbucks in south Tampa. They are always out of coffee..Really? This is a coffee shop. They should never be out of coffee. The service is terrible. Whoever manages this one should be fired. It's been terrible here for a very long time. Avoid.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  </td></tr>\n",
       "</tbody>\n",
       "</table>\n"
      ],
