       "\\hline\n",
       "\t Yooooo WTF!!!! Yoooo how's that even possible! Yooooo! They have only one background music and yooooo it's so terrible! Yooooooo! I stayed here for 30 minutes! Yoooo that stupid song is driving me crazy yoooo! WTF                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  \\\\\n",
       "\t they don't even deserve 1 star. this is the worst place ever. the workers are rude. constantly have attitudes. never listen to you or your order. they never let the drive through know that they are closed and there's always cars lined up to the rode waiting, little do they know the store is closed. this starbucks makes me angry every time i go and it honestly just makes me so angry at how dis organized they are and how non communicated they are with their customers. worst starbucks ever.!!!!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     \\\\\n",
       "\t I wait in the line 32 minutes to get my order and when I order they told me everything I order they told me they didn't have it and also all the time \n",
       "Different price they charge me and also they are fucking so mean and when they give me my Order all of it ice that is fucked up really fucked up and also the fucking drink it's just like a water taste                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       \\\\\n",
       "\t Okay very upset that I have to write a bad review.  The lady who was at the window 'preeti' is her name.  She was extremely unprofessional and damn right rude!! 1st seems pissed off by just seeing my face,doesn't give me a receipt, and as I'm waiting to ask her for it she rolls her eyes at me,so that pissed me off so I wait to tell her to be a little more respectful to customers and she closed the window on me while I was talking! !!!!!!!!!!! Corporate will hear from me if her boss doesn't do something about this.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                \\\\\n",
       "\t KYLIE HAS TERRIBLE CUSTOMER SERVICE SKILLS AND A VERY NASTY ATTITUDE. The ladies that work their are very rude. Insulted me on my vacation. And my coffee and food was very cold and nasty. If you hate your life because you work at Starbucks then quit, don't take it out on the customers. WORST Starbucks i have ever been too.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   \\\\\n",
       "\t Gross!! \n",
       "Toilet is fucking disgusting,one homeless woman taking over the condiment station eating and drinking her coffee and looking in the trash and another one talking to him \n",
       "Self in the seating area. No place to sit and it's freezing outside and I just paid \\$5 for coffee. FUCK this place                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                \\\\\n",
       "\t Kleine Starbucks Filiale. Nichts Besonderes, leider gibt es nur 2 bequeme Sessel, ansonsten nur harte Holzstühle.\n",
       "Die Bedienung war nett (was bei Starbucks nicht immer der Fall ist). Die Getränke schmeckten wie überall, was die Sache sehr angenehm macht. Man weiß, was man bekommt.\n",
       "Meine Gattin hatte Strawberry Smoothie, die Kids den \"Very Berry Hibiscus\" und ich, wie fast immer, den Venti Latte.\n",
       "Ich habe bei allen probiert :-), alles war sehr lecker.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              \\\\\n",
       "\t I absolutely hate going to this Starbucks, but I go occasionally because it's on my university campus. It is literally awful. The line is always very long. Then, when you get to the register they are ALWAYS out of everything. The staff is so rude!!! Today when I went, they were out of all alternative options of milk, which I am allergic to. They did not have almond, coconut or soy milk. This is a terrible place!!!!!!!!!!!!!!!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        \\\\\n",
       "\t As a Starbucks partner myself I expect to be treated exactly how we are trained to treat our customers when I go to a store. This Starbucks has the worst customer service I've seen in any Starbucks. \n",
       "I went through the drive thru. \n",
       "My order was rushed, put in incorrectly and misunderstood. When I got to the window the barista didn't have his name tag on and he was uninterested. I was charged for a drink I didn't receive. The shots were dead. The sandwich's egg was still frozen as well. This store should be ashamed of themselves.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               \\\\\n",
       "\t NASTY!\n",
       "I was there yesterday, second in line it took about 15 minutes for them to finish 1 order before me (4 mocha frap crap) yes!\n",
       "Also first time in my life to see FLIES in a starbucks whether target or not.\n",
       "FUCK THIS SHIT                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    \\\\\n",
       "\t WORST COFFEE WORST SERVICE.  I have not been there in 2 years because of that. I decided to go there this morning and after spending \\$7.00 on a coffee and a danish, I threw it out when I got to my office.\n",
       "For some reason the girl decided to heat my danish in a dirty oven because when I opened it there were flecks of burnt something on it.\n",
       " I did not ask for it to be heated.  The coffee was not hot.  There was no half and half. I had to wait for that to be filled.. So why in hell would anyone go there???????????????                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             \\\\\n",
       "\t This Starbucks has racist employees thst work for the company and needs to be fired ASAP !! This isn't back in the day this is now and no one should be getting called racist slurs while working for any company we ain't playing that shit !!!!                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      \\\\\n",
       "\t No stars. This place is the worst. Service sucks , people suck, all around just sucks.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 \\\\\n",
       "\t update: this location just get worse and worse. They are sooooooo slow it's absolutely horrendous. Their mobile order is completely useless. \n",
       "\n",
       "\n",
       "Holy crap they are slow. Stopped to get a drink through drive thru but won't again. Been waiting for over 5 mins and still have two cars ahead of me.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               \\\\\n",
       "\t Rude as hell the worst service didn't shake drink didn't even use manners I work in service I understand how hard it can be but the experience I had was ridiculous rude                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               \\\\\n",
       "\t I hate that this is the only Starbucks close to my work because it has the absolute worst customer service of any Starbucks I've ever been to.\n",
       "\n",
       " I always order ahead and do a mobile order so that I can come in and grab my drink and go but there have been multiple times where I have to wait 5 minutes for my drink because the dumb ass teenagers who work there are too busy standing at the register doing nothing.\n",
       "\n",
       "Once I came in and there were a few people standing by the window where you receive your drinks, so I asked the girl at the register- with short blond hair (who was doing absolutely nothing at the time) if she could hand me my mobile order and she told me to wait at the window with the other people. There was a guy making multiple drinks, so I stood there and waited five minutes and he was too busy to hand me my drink, so I went back to the girl with short blond hair and asked her to hand me my drink. She handed it to me and then proceeded to chastise me about how busy they were.\n",
       "\n",
